import React from 'react';

const Table = ({ rows }) => {
  return (
    <div className='table-content'>

    <table>
      <thead>
        <tr>
          <th>Date</th>
          <th>Description</th>
          <th>Category</th>
          <th>Amount</th>
        </tr>
      </thead>
      <tbody>
        {rows.map((row, index) => (
          <tr key={index}>
            <td>{row.date}</td>
            <td>{row.description}</td>
            <td>{row.category}</td>
            <td>{row.amount}</td>
          </tr>
        ))}
      </tbody>
    </table>
    </div>
  );
};

export default Table;
